import React, { useState, useEffect } from "react";
import styled from 'styled-components';
import CartRow from './cart';
export const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    color: #F1F1F1;
    text-align: center;
    padding-bottom: 60px;
    @media only all and (max-width: 570px) {
        margin-top: 95px;
    }
    flex: 0 0 66.666667%;
    max-width: 66.666667%;
    position: relative;
    width: 100%;
    display: flex;
    flex-wrap: wrap;
    margin-left: auto;
    margin-right: auto;    
    @media only all and (max-width: 1680px) {
        max-width: 80%!important;
        flex: 0 0 80%!important;
    }
    @media only all and (max-width: 1440px) {
    	max-width: 100%!important;
    	flex: 0 0 100%!important;
    }
`;
export const Title = styled.div`
    font-size: 35px;
    text-transform: uppercase;
    text-align: center;
    margin-left: auto;
    margin-right: auto;
    margin-top: 30px;
    @media only all and (max-width: 570px) {
        font-size: 26px;
    }
`;
export const TitleImage = styled.img`
    width: 100%;
    @media only all and (max-width: 570px) {
        margin-left: 20px;
        margin-right: 20px;
    }
`;
export default function Car_Long_Term() {
    const [dates, setData] = useState([]);
    async function componentDidMount() {
        try {
            const res = await fetch('/api/car/lungo/auto');
            const data = await res.json();
            setData(data);
        } catch (e) {
            console.log(e);
        }
    }
    useEffect(() => {
        componentDidMount();
    }, []);
    return(
        <>
        <Container>
            <TitleImage src="/static/images/top_image3.png"/>
            <Title>Noleggio a lungo termine</Title>
        </Container>
        <CartRow date={dates}/>
        </>
    );
}
